INSERT INTO `newstab` VALUES (7, 'cc7a7bce-3361-4e37-9057-4199d78019dc', 'f055725c-9bff-4f02-b81f-347ef792e384', 'c80c1f35-179e-467b-b035-e7540a254a8d', '2020考研政治大题万能答题套路', '', '<p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>套路一：找“题眼”</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　审题是在做任何题目之前必须要做的。审题，对象是题目，重点在审。审题的目的是要找到题目的题眼，知道题目的重点落在哪里，提问形式是什么?提问的内容是什么?要考查的知识点是哪些?大家都知道，考研政治主观题一般都会给出一大段长长的材料，有的题目甚至会给出两到三段的长材料，光是读完它们就已经花掉了很长时间了，并且这些材料中的很大一部分内容对我们做题都是没有什么用的，这简直就是在浪费我们珍贵的考试时间。所以要是不想在考场上被浪费宝贵的考试时间的话，就要在平时的训练中学会找到题目的“题眼”，然后迅速在材料中定位，找到正确的答案。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>套路二：列原理</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　每一道政治主观题都会对应到教材中具体的原理上，在读过材料之后要对材料和题目进行分析，找到题目考查的知识点，对应到相应的材料中，然后找出每一个相关的概念和原理，逐条列好，注意要多列出一些相关的原理。注意，我们要做的就是将原理逐条列好，而不是解释原理，不要有落下的原理就可以了。在答题的时候，要将列好的原理写在每一条答案的最前面，能够让阅卷老师一眼就看到这条原理就可以了。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>套路三：作解释</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　这一步，我们要在之前列好的原理的基础上对原理进行解释了。这里的解释包含有两重含义，一是自己对原理的理解，就是用浅显易懂的话将原理解释给阅卷老师听;第二，需要小伙伴们联系材料和具体的实际，对原理进行解释。在这里要注意联系实际，注意多结合材料，千万不要脱离了材料随意发挥，题目明明给你材料并且在题干中明晃晃地标明了“请结合材料”，就一定不要偏离题目，随意发挥了!切记!</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>套路四：重总结</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　根据题眼和得分点我们一步一步答完了整道题目，最后需要一两句总结的话来收尾。在答案的最后，我们要挑一两个自己认为非常重要的得分点再强调一遍，万一阅卷老师没有看到第一条，那我们就要保证他必须看到这一条。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>套路五：保卷面</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　在按照上面的步骤完整答完题目并做好总结后，最后一点是需要我们在平时的练习中要注意的，就是要保持卷面的整洁，字迹可以不漂亮，但一定要工整好认，卷面要条理列明，清晰明了，少涂涂画画。字体尽量避免用草书或连笔写字，一笔一划认真写好每个字。</p><p><br/></p>', '2019-07-17 14:53:23', NULL, 1, '', 'admin', '2019-07-17 14:53:23', NULL, NULL, NULL, NULL);
