(51, 51, 51); text-decoration-line: none;\">2019年经济师考试资格检验时间及方式</a>、<a title=\"\" href=\"http://www.exam8.com/kuaiji/jingjishi/baoming/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">经济师考试报名时间</a>等信息，请访问<a class=\"channel_keylink\" href=\"http://www.exam8.com/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">考试吧</a><a title=\"\" href=\"http://www.exam8.com/kuaiji/jingjishi/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">经济师考试</a>网。</p><p><br/></p>', '2019-07-17 14:55:11', NULL, 1, '', 'admin', '2019-07-17 14:55:11', NULL, NULL, NULL, NULL);
INSERT INTO `newstab` VALUES (9, '05761b9a-c7a2-4188-884c-d6677fcc4e3b', 'f055725c-9bff-4f02-b81f-347ef792e384', 'c80c1f35-179e-467b-b035-e7540a254a8d', '2019年6月计算机等级考试成绩查询入口开通最新文章', '', '<p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">2019年6月<a class=\"channel_keylink\" href=\"http://www.exam8.com/computer/djks/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">计算机等级考试</a>成绩查询入口</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　2019年6月<a class=\"channel_keylink\" href=\"http://www.exam8.com/computer/djks/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">计算机等级考试</a><span style=\"color:#ff0000\">成绩查询入口已开通</span>，考生可登录中国教育考试网或者点击下面链接进入成绩查询入口。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><a title=\"\" href=\"http://cjcx.neea.edu.cn/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><span style=\"text-decoration:underline;\"><strong><span style=\"color:#0000ff\">点击进入 2019年6月计算机等级成绩查询入口</span></strong></span></a></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><a title=\"\" href=\"http://cjcx.neea.edu.cn/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><img alt=\"2019年6月计算机等级考试成绩查询入口开通\" src=\"http://www.exam8.com/computer/UploadFiles/201907/2019071509101757.jpg\" width=\"98%\"/></a></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><a title=\"\" href=\"http://cjcx.neea.edu.cn/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">点击图片也可进入查询入口</a></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　<a class=\"channel_keylink\" href=\"http://www.exam8.com/computer/djks/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">计算机等级考试</a>实行百分制计分，但以等第通知考生成绩。等第共分优秀、及格、不及格三等。90-100分为优秀、60-89分为及格、0-59分为不及格。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　成绩在及格以上者，由教育部考试中心颁发合格证书。成绩优秀者，合格证书上会注明优秀字样。对四级科目，只有所含两门课程分别达到30分，该科才算合格。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　考生对成绩的任何疑问，应在省级承办机构下发成绩后5个工作日内，向所在考点提出书面申请。考点按省级承办机构的要求统一上报。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　更多关于<a title=\"\" href=\"http://www.exam8.com/computer/djks/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><span style=\"text-decoration:underline;\">2019年6月计算机等级考试成绩查询入口</span></a>等信息。</p>', '2019-07-17 14:59:05', NULL, 1, '', 'admin', '2019-07-17 14:59:05', NULL, NULL, NULL, NULL);
INSERT INTO `newstab` VALUES (10, '00b37f1a-a17e-410f-afb8-6e8f31f14ec0', 'f055725c-9bff-4f02-b81f-347ef792e384', 'c80c1f35-179e-467b-b035-e7540a254a8d', '安徽2019年9月全国计算机等级考试费用及缴费时间', '', '<p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　根据《<a title=\"\" href=\"http://www.exam8.com/computer/djks/dongtai/201906/4481204.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><span style=\"color:#0000ff\"><span style=\"text-decoration:underline;\">安徽2019年9月全国计算机等级考试报考简章</span></span></a>》得知，安徽2019年9月全国<a class=\"channel_keylink\" href=\"http://www.exam8.com/computer/djks/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">计算机等级考试</a>费用及缴费时间如下：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>　　</strong><strong>缴费时间为2019 年7月1日9:00至2019年7月13日17：30</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>　　报名考试费</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　我省NCRE考试报名执行皖价费[2006]240号文件收费标准规定，<strong>1-4级考试报名考试费按每人每科80元收取，使用分配为：考点40元，市考办5元，省考试院(含教育部考试中心费用)35元。</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>　　报名及缴费办法和程序</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　1.上网填报基本信息。考生可任意选择地点并在规定时间内上网填报、修改及查询本人信息。填报过程分为登录、查看提示信息、输入并提交报考信息、申请信息审核及等待“审核确认”结果。修改和查询与填报过程相同。考生在申请信息审核前须认真核对本人所填报的各项信息，须对本人所填报的各项信息准确性负全责。姓名、地名等信息项中如存在字库中没有的汉字，以拼音全拼(半角大写字母)代替。考生报考信息审核通过后，所有报考信息一律不得变更。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　2.报名信息审核确认。考点学校须在报名期间安排专人每天(24小时之内必须完成审核确认)对报考自己考点学校的已提交“审核确认”的考生信息进行审核及确认(主要审核照片是否符合要求，照片不符合要求的须按照考生所留联系方式通知考生重新上传照片)。对报考自己考点学校但一直未提交“审核确认”的考生，考点学校须按照考生所留联系方式通知考生及时提交“审核确认”。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　3.网上缴费。考生须在信息审核确认通过后在缴费时间内按规定进行网上缴费。未在规定时间内缴纳报名考试费的考生将视为自行放弃报名及考试资格，将不予编排考场。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　4.考点学校组织集体报名及缴费。为了确保我省NCRE网上报名及缴费工作的顺利进行，考点学校可组织本校考生进行集体报名及缴费。组织集体报名的考点学校须在报名及缴费时间内完成相应的报名、信息审核确认、缴费工作，并确保集体报名的考生信息的准确性，出现问题由考点学校负责。具体的集体报名及缴费时间由考点学校自行安排。</p><p><br/></p>', '2019-07-17 15:01:12', NULL, 1, '', 'admin', '2019-07-17 15:01:12', NULL, NULL, NULL, NULL);
INSERT INTO `newstab` VALUES (11, 'bc23efa5-ede5-41db-8950-fe688a3c7eca', 'f055725c-9bff-4f02-b81f-347ef792e384', 'c80c1f35-179e-467b-b035-e7540a254a8d', '各地2018年12月全国计算机等级考试报名时间汇总', '', '<table class=\"lianjielanse\" width=\"100%\" align=\"center\"><tbody><tr align=\"center\" valign=\"middle\" class=\"firstRow\"><td width=\"207\" align=\"center\" style=\"font-size: 12px;\"><strong>省份</strong></td><td width=\"1046\" align=\"center\" style=\"font-size: 12px;\"><strong>2018年12月全国<a class=\"channel_keylink\" href=\"http://www.exam8.com/computer/djks/\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">计算机等级考试</a>报名时间汇总</strong></td><td width=\"387\" align=\"center\" style=\"font-size: 12px;\"><strong>查看详情/报名入口</strong></td></tr><tr align=\"center\" valign=\"middle\"><td align=\"center\" style=\"font-size: 12px;\"><strong>上海</strong></td><td align=\"left\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201811/4349659.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">2018年11月13日-11月19日</a></td><td align=\"center\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201811/4357277.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">报名入口</a></td></tr><tr align=\"center\" valign=\"middle\"><td align=\"center\" style=\"font-size: 12px;\"><strong>重庆</strong></td><td align=\"left\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201810/4345544.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">2018年11月1日-11月15日</a></td><td align=\"center\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201811/4349600.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">报名入口</a></td></tr><tr align=\"center\" valign=\"middle\"><td align=\"center\" style=\"font-size: 12px;\"><strong>天津</strong></td><td align=\"left\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201810/4343145.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">2018年11月10日-11月15日</a></td><td align=\"center\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201811/4355819.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">报名入口</a></td></tr><tr align=\"center\" valign=\"middle\"><td align=\"center\" style=\"font-size: 12px;\"><strong>西藏</strong></td><td align=\"left\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201811/4360219.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">报名时间汇总</a></td><td align=\"center\" style=\"font-size: 12px;\"><a href=\"http://www.exam8.com/computer/djks/baoming/201811/4360219.html\" target=\"_blank\" style=\"color: rgb(0, 51, 255); text-decoration-line: none;\">查看详情</a></td></tr><tr align=\"center\" valign=\"middle\"><td colspan=\"3\" align=\"right\" style=\"font-size: 12px;\"><br/></td></tr></tbody></table><p><br/></p>', '2019-07-17 15:02:02', NULL, 1, '', 'admin', '2019-07-17 15:02:02', NULL, NULL, NULL, NULL);
INSERT INTO `newstab` VALUES (12, 'a8cb9d2b-eadc-4078-9a35-0935a54d17c5', '95b4337d-a177-4828-b725-f377e2fad025', 'c80c1f35-179e-467b-b035-e7540a254a8d', '2020考研政治主观题5类高分冲刺答题模板', '', '<p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>一.毛概、马原类答题模板</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(一)唯物辩证法认为：矛盾具有普遍性和特殊性，普遍性寓于特殊性之中，通过特殊性表现。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(二)认识论认为：认识需要经过两次飞跃获得真理，感性认识上升到理性认识是一个去粗取精的过程，理性认识要付诸于实践去检验真理的正确性从材料中我们可以看出……。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(三)我党之所以坚持……的政策这是由我国特殊国情(主要矛盾，任务)和政策对象的特点(对象是怎样产生的，对象对革命的态度)共同决定的。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>二.经济类答题模板</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(一)国内经济意义：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　1.(有利于)充分发挥市场在资源配置中的基础性作用，实现资源的优化配置;促进结构调整(经济结构产业结构等)，带动相关产业的发展，促进就业。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2.(有利于)调动积极性，解放生产力，提高经济效益，增加收入，提高人民生活水平。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　3.(有利于)统筹区域发展;促进经济合作交流，实现生产要素合理流动，经济互补;增强竞争力。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　4.(有利于)体现社会主义本质，缩小差距，实现共同富裕;全面实现小康目标，提高我国的国际竞争力。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　5.(有利于)落实科学的发展观;走新型工业化道路。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(二)描述对外经济意义：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　1.(有利于)提高对外开放水平，促进对外贸易，增强国际竞争力;充分利用国际国内两个市场，两种资源，吸收引进资金，技术，管理经验;实施走出去战略，为我国的现代化建设创造良好的国际(周边)环境。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2.(有利于)建立国际经济新秩序等。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>三.哲学类答题模板</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(一)A决定B，B对A具有反作用，积极的促进作用，消极的阻碍作用。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(二)事物是普遍联系的,要求我们用联系的观点看问题。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(三)整体和部分的关系,要求我们树立全局观念，立足整体，统筹全局，选择正确方案，实现整体最优目标，从而达到整体功能大于各部分功能总和的目标。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(四)内因和外因的关系。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(五)事物是变化发展的,要求我们用发展的眼观看问题。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(六)矛盾普遍性与特殊性的辨证关系，要求我们遵循由特殊到普遍在到特殊的认识规律，坚持一般要求和个别指导相结合的工作指导。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>四.政府类的答题模板</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(一)国家性质:我国是工人阶级领导的，以工农联盟为基础的人民民主的社会主义国家。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(二)我国政府的职能：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　1.保障人民民主和维护国家长治久安的职能。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2.组织社会主义经济建设的职能。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　3.组织社会主义文化建设的职能。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　4.提供社会公共服务的职能。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(三)我国政府应该坚持的原则和宗旨:</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　宗旨：为人民服务。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　原则：对人民负责。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(四)政府依法行政的意义：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　1.是贯彻依法治国方略,提高行政管理水平的基本要求，也体现了对人民负责的原则。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2.有利于保障人民群众的权利和自由。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　3.有利于加强廉政建设,增强政府权威。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　4.有利于提高行政管理水平。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　5.有利于推进社会主义民主法治建设。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>五.国际关系类的答题模板</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(一)国家利益：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　1.维护国家利益是主权国家对外活动的动因和归宿。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2.国家间的共同利益是国家合作的基础，而利益的冲突和对立是国家摩擦和冲突的根源。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(二)国家的权利与义务：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　权利:独立权,自卫权,管辖权平等权。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　义务:不侵犯别国,不干涉他国内政,以和平方式解决国际争端。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(三)联合国宪章的宗旨与原则:</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　宗旨:维护国际和平与安全，促进国际合作与发展。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　原则:各会员国主权平等,履行宪章规定的义务，和平解决国际争端。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(四)我国的国家性质和国家利益决定我国的外交政策。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(五)国际竞争的实质：是以经济，军事实力为基础的综合国力的竞争。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(六)和平与发展是当今时代的主题，顺应了经济全球化和世界多极化发展的要求，有利于促进国际关系民主化。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　(七)我国独立自主和平外交政策的内容：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　基本目标：维护我国的独立和主权，促进世界的和平与发展。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　基本立场：独立自主。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　基本准则：和平共处五项原则。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　以上就是为大家总结的政治主观题必备语句，希望能给大家带去一些帮助!但是同学们不能完全依赖这个模板，还是要好好复习，抓紧最后这段时间。最后，祝2020考研学子万事如意，金榜题名!</p><p><br/></p>', '2019-07-17 15:03:20', NULL, 1, '', 'admin', '2019-07-17 15:03:20', NULL, NULL, NULL, NULL);
INSERT INTO `newstab` VALUES (13, 'fd8cfe7d-e7ac-4bf3-8146-170fda78b5e9', '95b4337d-a177-4828-b725-f377e2fad025', 'c80c1f35-179e-467b-b035-e7540a254a8d', '湖南2019年秋季教师资格证认定时间10月15日-10月30日', '', '<p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　根据《<a title=\"\" href=\"http://www.exam8.com/zige/jiaoshi/rending/201904/4439683.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><span style=\"text-decoration:underline;\"><span style=\"color:#0000ff\">2019湖南教师资格认定、教师资格考试与定期注册公告</span></span></a>》得知，湖南2019年秋季教师资格证<span style=\"color:#ff0000\">认定时间为10月15日-10月30日</span>。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2019年湖南教师资格认定所需材料如下：</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　1.身份证原件(需在有效期内)。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　2.户口簿或居住证(仅限于申请中小学教师资格);拟聘任教师职务的相关证明原件和复印件(仅限于申请高等学校教师资格);应届毕业生提交所在学校学籍管理部门出具的在籍学习证明(认定系统验证通过的则无须提交)。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　3.学历证书原件。港澳台学历还应同时提交教育部留学服务中心出具的《港澳台学历认证书》原件，国外学历还应同时提交教育部留学服务中心出具的《国外学历认证书》的原件。国内高等学校毕业生，不能提供学历证书原件的，须提交《中国高等教育学历认证报告》(在学信网在线申请)。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　4.普通话水平测试等级证书原件(认定系统无法验证申请人普通话水平测试等级的，需要现场审查验证取得的《普通话水平测试等级证书》原件)。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　5.教师资格认定机构指定的县级以上医院(其中申请高等学校教师资格的，应为学校所在地的市州级以上医院)出具的当年体格检查合格证明。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　6.《个人承诺书》(申请人在教师资格网报系统界面下载打印，本人签名拍照后，在填写申报信息时按格式要求上传)。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　7.2015年12月31日前入学的全日制师范教育类专业毕业生只能申请直接认定与所学专业相同或相近任教学科的教师资格，且须提交就读学校培养师范生的资质证明、毕业生名册、入学录取名册及相应学历层次的师范教育专业课程和教育实习成绩复印件。否则，需要参加相应的中小学<a class=\"channel_keylink\" href=\"http://www.exam8.com/zige/jiaoshi/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">教师资格考试</a>。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　8.非师范教育类专业毕业人员申请中小学教师资格，须提交由教育部考试中心统一颁发的相应教师资格种类的《中小学<a class=\"channel_keylink\" href=\"http://www.exam8.com/zige/jiaoshi/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">教师资格考试</a>合格证明》(由申请人网上自行下载打印，认定系统能验证通过的可不提交)。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　9.申请高等学校教师资格，须提交《高校教师岗前培训合格证》或者《高等学校新入职教师国培示范项目培训合格证书》和聘用合同书等证明原件及复印件;非师范教育类专业毕业人员申请高等学校教师资格，还须提交《湖南省申请认定教师资格面试、试讲情况登记表》</p><p><br/></p>', '2019-07-17 15:06:14', NULL, 1, '', 'admin', '2019-07-17 15:06:14', NULL, NULL, NULL, NULL);
INSERT INTO `newstab` VALUES (14, '37764617-b0ba-4471-9994-28e67a579906', '95b4337d-a177-4828-b725-f377e2fad025', 'c80c1f35-179e-467b-b035-e7540a254a8d', '2019年6月英语四六级考试成绩查询时间通知', '', '<p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">2019年6月<a class=\"channel_keylink\" href=\"http://www.exam8.com/english/CET46/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">英语四六级考试</a>成绩查询时间</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　根据历年上半年大学英语四六级考试成绩查询时间，考试吧<span style=\"color:#ff0000\">预计</span><span style=\"color:#ff0000\">2019年6月大学英语四六级考试成绩查询</span><span style=\"color:#ff0000\">于8月中下旬开始</span>。届时，考生可以通过中国教育考试网(http://cet.neea.edu.cn/cet)或中国高等教育学生信息网(<a href=\"http://www.chsi.com.cn/cet\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">http://www.chsi.com.cn/cet</a>)查询考试成绩。如考生的口试成绩为D等，成绩报告单上不再报道其口试成绩。</p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　<strong>*网上成绩查询方式：</strong></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　中国教育考试网，网址:&nbsp;<a title=\"\" href=\"http://cet.neea.edu.cn/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><span style=\"text-decoration:underline;\"><span style=\"color:#0000ff\">http://cet.neea.edu.cn/</span></span></a></p><p style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(243, 248, 254);\">　　中国高等教育学生信息网，网址:&nbsp;<a title=\"\" href=\"http://www.chsi.com.cn/cet\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\"><span style=\"text-decoration:underline;\"><span style=\"color:#0000ff\">http://www.chsi.com.cn/cet</span></span></a></p><p style=\"col